import base64

from bitarray import bitarray
import sys
import os

def decompress(src, dst, debug=False):

    if debug:
        print("[~~~ Decompressing file ~~~]")
        print("src:\t", src)
        print("dst:\t", dst)

    b = bitarray()

    with open(src, 'rb') as f:
        b.fromfile(f)

    b = b.tolist()
    b = [int(z) for z in b]
    buf = ''
    for x in b:
        buf += str(x)

    # Get number of b64 symbols to read
    if debug:
        print('[~~Reading from buffer~~]')
    len_buffer = int(buf[0:32], 2)
    if debug:
        print("1] encoding size: \t", len_buffer, '\t', buf[0:32])
    buf = buf[32:]

    num_letters = int(buf[0:7], 2)
    if debug:
        print("2] hashtable size: \t", num_letters, '\t', buf[0:7])

    buf = buf[7:] # Pop off
    num_letters_collected = 0
    hash_dic = {}
    if debug:
        print('[~~~deconstructing hashtable~~~]')
    while num_letters_collected < num_letters:
        len_hash = int(buf[0:4], 2)
        if debug:
            print("\n3a] hash block size: \t", len_hash, '\t', buf[0:4])

        buf = buf[4:]
        num_keys = int(buf[0:6], 2)
        if debug:
            print("3b] no. hashes in block:", num_keys, '\t', buf[0:6])

        buf = buf[6:]
        for x in range(num_keys):
            char_string = buf[0:8]
            if debug:
                print("\t[~~hb~~]")
                print("\t3c] utf-8\t", chr(int(char_string, 2)), '\t', buf[0:8])
            buf = buf[8:]

            hash_key = buf[0:len_hash]
            if debug:
                print("\t3c] hash\t", hash_key)
            buf = buf[len_hash:]
            num_letters_collected += 1
            hash_dic[hash_key] = chr(int(char_string, 2))


    output = ''
    total_captured = 0
    while(len(buf) and total_captured <= len_buffer):
        solved = False

        for x in range(16):
            if buf[:x] in hash_dic:
                print("_______")
                print(buf[:x])
                print(total_captured, len_buffer)

                output += hash_dic[buf[:x]]
                buf = buf[x:]
                #print(output)
                print(len(buf))
                total_captured += 1
                solved = True

                break
        if not solved:
            output += "="
            total_captured += 1
    print(output)
    with open(dst, 'wb') as f:
        decoded_data = base64.decodebytes(output.encode('utf-8'))
        f.write(decoded_data)

if __name__ == "__main__":
    print(sys.argv)
    i = sys.argv[1]
    o = sys.argv[2]
    assert os.path.exists(i) # Check if input file exists.
    #assert os.path.exists(o) # Check if output file exists.
    decompress(i, o, debug=True)

